  const params = useParams();
  const bucket_list = useSelector((state) =>  state.bucket.list);
  const bucket_index = params.index;

  console.log(bucket_list[bucket_index])
  return (
    <h1>상세 페이지입니다!</h1>
  )
};

export default Detail;
